import React from 'react';
import './Card.css';
export default function Card(props){
    return(
        <>
          <div className="p-c" onClick={()=>{
            location.href="https://type-ing.netlify.app";
          }}>
              <div className="p-c-img">
                 <img src={props.image} alt="" />
              </div>
              <div className="p-c-title">
                  {props.title}
              </div>
              <div className="p-c-des">
                {props.des}
              </div>
          </div>
        </>
    )
}
